import * as actionTypes from "./types";

export const setUser = (user) => ({
  type: actionTypes.SET_USER,
  payload: user,
});

export const setUSerStatus = (userStatus) => ({
  type: actionTypes.SET_USER_STATUS,
  payload: userStatus,
});
